import React,{ } from 'react'
import { useRouter } from 'next/router'
import Axios from 'axios'

const Pokemon = () => {
    const router = useRouter()
    const name = router.query.name

    if(name){
        Axios.get(`https://pokeapi.co/api/v2/pokemon/${name}`)
    }


    return (
        <h1>POKEMON: { name }</h1>
    )
}

export default Pokemon
